records.addlTxt:
Defendant in custody on WRIT.
GUILTY plea entered to count 1, OWI-5th offense. Convicted.
The State moves to dismiss and read in counts 2 and 3.  Motion granted.
Sentence Withheld.  Defendant is placed on probation to DOC for three (3) years.
Conditions of probation:
1) Spend one (1) year in the county jail, under the Huber Law, commencing immediately.  Court authorizes transfer to Brown County Jail;
2) Pay $1,100.00 fine plus costs, total of $2,400.00;
3) Intoxicated Driver Assessment and Driver Safety Plan;
4) pay supervision fees in an amount to be determined by DOC;
5) Provide DNA sample and pay the surcharge.
In addition, the Court orders a thirty-six (36) month DL revocation and period of Ignition Interlock.
Minutes.
